import React, { useState } from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { useNavigate } from 'react-router-dom';
import '../styles/Login.css';

const Login = () => {
  const [loginData, setLoginData] = useState({ email: '' });
  const navigate = useNavigate();

  const handleChange = (e) => {
    setLoginData({ ...loginData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Account created for:', loginData);
    navigate('/home');
  };

  return (
    <>
      {/* Navbar */}
      <nav className="navbar">
        <div className="navbar-container">
          <h1 className="navbar-logo">BukSU Lost and Found</h1>
          <ul className="navbar-links">
            <li><a href="/">Home</a></li>
            <li><a href="/login">Login</a></li>
            <li><a href="/admin">Admin</a></li>
            <li><a href="/register">Register</a></li>
          </ul>
        </div>
      </nav>

      {/* Login Page */}
      <div className="login-container">
        <div className="login-content">
          <h1 className="title">Happening now</h1>
          <h2 className="subtitle">Join today.</h2>
          <div className="google-login">
            <GoogleLogin onSuccess={() => console.log('Google Login Success')} onError={() => console.log('Login Failed')} />
          </div>
          <button className="apple-login">Sign up with Apple</button>
          <div className="divider">or</div>
          <form onSubmit={handleSubmit}>
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={loginData.email}
              onChange={handleChange}
              required
            />
            <button type="submit" className="create-account">Create account</button>
          </form>
          <p className="terms">
            By signing up, you agree to the <a href="#">Terms of Service</a> and <a href="#">Privacy Policy</a>.
          </p>
          <p className="already">
            Already have an account? <a href="/login" className="signin">Sign in</a>
          </p>
        </div>
      </div>
    </>
  );
};

export default Login;
